import React from 'react';
import axios from 'axios';

function App(){
    React.useEffect(function(){
        async function fetchAllUsers(){
            const res = await axios.get('http://localhost/users');
            console.log(res)
        }
    },[])

    return(
        <div>
            <h1>Hello React !</h1>
            <p>Testing the axios API</p>
        </div>
    )
}
export default App;
